Spring + MongoDB Use nonReactive and Reactive repository at once<p>I have a SpringBoot + Mongo application, implemented with non-reactive Repositories (<em>extends MongoRepository&lt;MyDocument, String&gt;</em>) and everything works fine.
Now I need to implement an auditing system and I wanted to develop it by using Mongo's <strong>ChangeStreams</strong> and Spring's Reactive Change Streams (<a href="https://docs.spring.io/spring-data/mongodb/docs/current-SNAPSHOT/reference/html/#reference" rel="nofollow noreferrer">reference</a>). I tried to create 3 classes to achieve this:</p>
<p><strong>MongoMessageListener</strong></p>
<pre><code>@Component
@Slf4j
public class MongoMessageListener implements MessageListener&lt;ChangeStreamDocument&lt;Document&gt;, MyDocument&gt; {

    @Override
    public void onMessage(Message&lt;ChangeStreamDocument&lt;Document&gt;, MyDocument&gt; message) {

        OperationType operationType = message.getRaw().getOperationType();

        log.info(&quot;Operation type is : {}&quot;, operationType);

        log.info(&quot;Received Message in collection: {},message raw: {}, message body:{}&quot;,
                message.getProperties().getCollectionName(), message.getRaw(), message.getBody());
    }
}
</code></pre>
<p><strong>MongoListenerConfig</strong></p>
<pre><code>@Configuration
@Slf4j
public class MongoStreamListenerConfig extends AbstractReactiveMongoConfiguration {

    @Bean
    MessageListenerContainer changeStreamListenerContainer(
            MongoTemplate template,
            MongoMessageListener consentAuditListener,
            ErrorHandler errorHandler) {

        MessageListenerContainer messageListenerContainer =
                new MongoStreamListenerContainer(template, errorHandler);

        ChangeStreamRequest&lt;ParentContentDocument&gt; request =
                ChangeStreamRequest.builder(consentAuditListener)
                        .collection(&quot;my_document_collection&quot;)
                        .filter(newAggregation(match(where(&quot;operationType&quot;).is(&quot;update&quot;))))
                        .fullDocumentLookup(FullDocument.UPDATE_LOOKUP)
                        .build();

        messageListenerContainer.register(request, MyDocument.class, errorHandler);
        log.info(&quot;&gt; Mongo Stream Listener is registered&quot;);
        return messageListenerContainer;
    }

    @Override
    protected String getDatabaseName() {
        return &quot;myDatabase&quot;;
    }

    @Bean
    ErrorHandler getLoggingErrorHandler() {
        return new ErrorHandler() {
            @Override
            public void handleError(Throwable throwable) {
                log.error(&quot;Error in creating audit records {}&quot;, throwable.getMessage());
            }
        };
    }
}
</code></pre>
<p><strong>MongoStreamListenerContainer</strong></p>
<pre><code>public class MongoStreamListenerContainer extends DefaultMessageListenerContainer {

    public MongoStreamListenerContainer(MongoTemplate template, ErrorHandler errorHandler) {
        super(template, Executors.newFixedThreadPool(15), errorHandler);
    }

    @Override
    public boolean isAutoStartup() {
        return true;
    }
}
</code></pre>
<p>I also added a repo which extends <code>ReactiveMongoRepository&lt;MyDocument, String&gt;</code></p>
<p>When I try to run my application it raises multiples errors of ClassNotFoundException ([...] <code>'reactiveStreamsMongoClient' threw exception; nested exception is java.lang.NoClassDefFoundError: com/mongodb/internal/connection/InternalConnectionPoolSettings</code>) , or @Autowired to import repositories into Services not satisfied (<em>Autowired(required=true)}</em>)</p>
<p>In my Main.java class I tried to set both <code>@EnableMongoRepositories(basePackages = &quot;com.my.path.to.repository&quot;)</code>  and <code>@EnableReactiveMongoRepositories(&quot;com.my.path.to.reactive.repository&quot;)</code> , but nothing seems to work.
I doubted I could't squeeze together non-reactive and reactive repos, but I found <a href="https://stackoverflow.com/questions/68435903/how-to-use-both-reactive-and-non-reactive-mongodb-template-on-webflux-applicatio">this SO question</a> and some more, so I guess you can.
I tried to follow <a href="https://github.com/spring-projects/spring-data-mongodb/tree/main/src/main/asciidoc/reference" rel="nofollow noreferrer">this Spring project</a> step-by-step, but I always get ClassNotFound errors.</p>
<p>In my pom I have</p>
<pre><code>&lt;dependency&gt;
 &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;
 &lt;artifactId&gt;spring-boot-starter-data-mongodb&lt;/artifactId&gt;
 &lt;version&gt;2.5.3&lt;/version&gt;
&lt;/dependency&gt;
&lt;dependency&gt;
 &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;
 &lt;artifactId&gt;spring-boot-starter-data-mongodb-reactive&lt;/artifactId&gt;
 &lt;version&gt;2.5.3&lt;/version&gt;
&lt;/dependency&gt;
&lt;dependency&gt;
 &lt;groupId&gt;org.mongodb&lt;/groupId&gt;
 &lt;artifactId&gt;mongodb-driver-reactivestreams&lt;/artifactId&gt;
 &lt;version&gt;4.6.1&lt;/version&gt;
&lt;/dependency&gt;
&lt;dependency&gt;
 &lt;groupId&gt;io.projectreactor&lt;/groupId&gt;
 &lt;artifactId&gt;reactor-core&lt;/artifactId&gt;
 &lt;version&gt;3.4.19&lt;/version&gt;
&lt;/dependency&gt; 
</code></pre>
<p>I really cant' see what I'm missing: if it's just some configurations or if I can't mix non-reactive and reactive repos (even though I found users say you can). Any help will be VERY much appreciated, it's driving me a bit crazy! Thank you so much!</p>

