<p>Running the code below I always get this error: <code>Updating the path 'giveaways.duration' would create a conflict at 'giveaways'</code>. Can anyone help solving this issue ?</p>
<p>schema.js</p>
<pre><code>const giveawaySchema = new mongoose.Schema({  
    _id: String,
    destination: String,
    duration: String,
    winners: String,
    price: String,
})

const mainSchema = new mongoose.Schema({
    _id: String,
    log_channel_id: String,
    admin_roles: [],
    giveaways: [giveawaySchema],

const Main = mongoose.model(&quot;mainSchema&quot;, mainSchema);
const Giveaway = mongoose.model(&quot;giveawaySchema&quot;, giveawaySchema);

module.exports = { Main, Giveaway }
});
</code></pre>
<p>Part of my code used for updating:</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;)
const {Main, Giveaway} = require(&quot;../models/schema.js&quot;)

const newestGiveaway = await Main.findOneAndUpdate(
    {
        _id: guildId,
        'giveaways._id': giveaway_id,
    },  
    {   
        &quot;$set&quot;:{
            &quot;giveaways.duration&quot;: &quot;3d&quot;,
            &quot;giveaways.winners&quot;: &quot;20&quot;,
            &quot;giveaways.price&quot;: &quot;Price to Win&quot;,
         },
    },
    {
        upsert: true,
    }

</code></pre>
<p>Thank you for your help :)</p>
<p>A small side question. I have fetched the Main document (the parent) before already can I make my search cheaper/ more efficent by only searching through this instead of running the findOneandUpdate method on the whole database ?</p>
<p><strong>Edit 1:</strong></p>
<p>I found that it is neccesary to use the $ operator and have updated my code. However I still get the same error:</p>
<pre><code>{
   $set:{
      &quot;giveaways.$.duration&quot;: &quot;3d&quot;,
      &quot;giveaways.$.winners&quot;: &quot;20,
      &quot;giveaways.$.price&quot;: &quot;Price to Win&quot;,
   },
},
</code></pre>
<p><strong>Edit 2:</strong></p>
<p>Just to clarify, the creation and nesting of the giveawaySchemas works but I am not able to update the nested document by using the code above.
My child component is already created by using the code below. I now want to update this child (<code>newGiveaway</code> with <code>_id</code> of 1)</p>
<pre><code>const currentGuild = await Main.findOne({_id: guildId})

const newGiveaway = await Giveaway.create({
    _id: 1,
    destination: 12345678,
});

currentGuild.giveaways.push(newGiveaway)

</code></pre>

