JSON array saves in disorder in MongoDB using the .save() method of mongoose<p>I need to save a long JSON array in a collection in a free MongoDB database.</p>
<p>For that I connect to my database via mongoose then I make a <code>for</code> loop which will read each JSON of my array and save it with the good model in the good collection thanks to the <code>save()</code> method of <code>mongoose</code>. I make this connection in an application that uses node and the express framework.</p>
<p>This is the following code, which I tried to simplify, that does this:</p>
<pre><code> const data = [
  {
    &quot;numero&quot;: 1531,
    &quot;annee&quot;: 2022,
    &quot;date&quot;: &quot;22/05/2022&quot;,
    &quot;premier_cas&quot;: 10
  },
  {
    &quot;numero&quot;: 1532,
    &quot;annee&quot;: 2022,
    &quot;date&quot;: &quot;29/05/2022&quot;,
    &quot;premier_cas&quot;: 15
  }
//MANY THOUSANDS OF OBJECT
];

const mongoose = require('mongoose');
mongoose.Promise = global.Promise;
const db = {};
db.mongoose = mongoose;
db.result = require(&quot;./result.model&quot;);

const Result = db.result;

db.mongoose
  .connect(process.env.MONGODB_URI, {
    useNewUrlParser: true,
    useUnifiedTopology: true
  })
  .then((client) =&gt; {
    console.log(&quot;Successfully connect to MongoDB.&quot;);
    addResultToCollection();
  })
  .catch(err =&gt; {
    console.error(&quot;Connection error&quot;, err);
    process.exit();
  });

function addResultToCollection() {
  Result.estimatedDocumentCount(async (err, count) =&gt; {
    if (!err &amp;&amp; count === 0) {
      for (let i = 0; i &lt; data.length; i++) {
        await createAndSaveOneResult(data[i], i);
      }
    } else if (count !== 0) {
      console.log(&quot;Results have already been created!&quot;);
    }
  });
}

async function createAndSaveOneResult(json, counter) {
  new Result({
    numero: json.numero,
    annee: json.annee,
    date: json.date,
    premier_cas: json.cas
  }).save(err =&gt; {
    if (err) {
      console.log(&quot;error&quot;, err);
    }
    console.log(&quot;Results %d a été créé&quot;, counter);
  });
}
</code></pre>
<p>My model Result is the following :</p>
<pre><code>const mongoose = require('mongoose');

const Result = mongoose.model(
    &quot;Result&quot;,
    (new mongoose.Schema({
        numero: {
            type: Number,
            required: 'This field is required'
        },
        annee: {
            type: Number,
            required: 'This field is required'
        },
        date: {
            type: String,
            required: 'This field is required'
        },
        premier_cas: {
            type: Number,
            required: 'This field is required'
        },
    })).index({ &quot;$**&quot;: 'text' })
);

module.exports = Result;
</code></pre>
<p>This code allows me to connect to my database and save the thousands of JSONs that are contained in my array. The problem is that the recording is not done in the right order, when I display the number of the object created in my terminal at the time of its creation I get this :</p>
<pre><code>...
Results 947 a été créé
Results 942 a été créé
Results 988 a été créé
Results 995 a été créé
Results 994 a été créé
Results 1000 a été créé
Results 997 a été créé
Results 996 a été créé
Results 987 a été créé
Results 990 a été créé
Results 991 a été créé
Results 989 a été créé
Results 992 a été créé
Results 993 a été créé
Results 1003 a été créé
Results 1001 a été créé
Results 999 a été créé
Results 998 a été créé
Results 1004 a été créé
Results 1002 a été créé
Results 1007 a été créé
Results 986 a été créé
Results 1020 a été créé
Results 1011 a été créé
...
</code></pre>
<p>When I look at the new objects registered in my MongoDB collection they are also in disorder,, so it's not a timing issue because of the local <code>console.log()</code> which would fail to keep up with the saving in MongoDB.</p>
<p>To solve this problem and put my objects in the right order I tried to use async/await logic to wait for the <code>save()</code> method to be performed before saving the next object, this is what I did in the code above. But the problem remained the same.</p>
<p>I also tried to put a <code>setTimeOut()</code> in my <code>for</code> loop to wait two seconds between each object registration, this is the following code but the problem remained the same.</p>
<pre><code>db.mongoose
  .connect(process.env.MONGODB_URI, {
    useNewUrlParser: true,
    useUnifiedTopology: true
  })
  .then((client) =&gt; {
    console.log(&quot;Successfully connect to MongoDB.&quot;);
    addResultToCollection();
  })
  .catch(err =&gt; {
    console.error(&quot;Connection error&quot;, err);
    process.exit();
  });

function addResultToCollection() {
  Result.estimatedDocumentCount(async (err, count) =&gt; {
    if (!err &amp;&amp; count === 0) {
      for (let i = 0; i &lt; data.length; i++) {
        setTimeout(() =&gt; {
          new Result({
            numero: data[i].numero,
            annee: data[i].annee,
            date: data[i].date,
            premier_cas: data[i].premier_cas
          }).save(err =&gt; {
            if (err) {
              console.log(&quot;error&quot;, err);
            }
            console.log(&quot;Results %d a été créé&quot;, i);
          });
        }, &quot;2000&quot;)
      }
    } else if (count !== 0) {
      console.log(&quot;Results have already been created!&quot;);
    }
  });
}
</code></pre>
<p>If anyone knows how to fix this problem and get the objects in the array to save in the right order it would be a great help.</p>

